import React from "react";
import { Button, Box, Typography, AppBar, Tabs, Tab } from "@material-ui/core";

const ObjectPage = ({ data, onBack }) => {
  const [activeTab, setActiveTab] = React.useState(0); // State to track active tab

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue); // Update active tab based on user selection
  };

  return (
    <div style={{ padding: "16px" }}>
      {/* Back button and Reimbursement ID */}
      <Button variant="outlined" color="primary" onClick={onBack}>
        Back to List
      </Button>
      <Typography variant="h5" style={{ marginTop: "16px", marginBottom: "16px" }}>
        Reimbursement ID: {data.reimbursmentId}
      </Typography>

      {/* Tab Navigation */}
      <AppBar position="static">
        <Tabs value={activeTab} onChange={handleTabChange} variant="scrollable" scrollButtons="auto">
          <Tab label="General Information" />
          <Tab label="Reimbursement Details" />
          <Tab label="Attachments" />
          <Tab label="Workflow History" />
          <Tab label="Comments" />
        </Tabs>
      </AppBar>

      {/* Tab Content */}
      <Box padding={2} border={1} borderColor="grey.300" borderRadius="4px" marginTop="16px">
        {/* General Information */}
        {activeTab === 0 && (
          <Box>
            <Typography variant="h6">General Information</Typography>
            <Box display="flex" flexDirection="column" marginTop={2}>
              <Box display="flex" justifyContent="space-between" marginBottom={1}>
                <Typography variant="body1"><strong>Reimbursement Date:</strong> {data.reimbursementDate}</Typography>
                <Typography variant="body1"><strong>Total Amount:</strong> {data.totalAmount}</Typography>
                <Typography variant="body1"><strong>Status:</strong> {data.status}</Typography>
              </Box>
            </Box>
          </Box>
        )}
        {/* Other tabs content goes here */}
        {activeTab === 1 && <Typography variant="body1">Reimbursement details content goes here.</Typography>}
        {activeTab === 2 && <Typography variant="body1">Attachments content goes here.</Typography>}
        {activeTab === 3 && <Typography variant="body1">Workflow history content goes here.</Typography>}
        {activeTab === 4 && <Typography variant="body1">Comments content goes here.</Typography>}
      </Box>
    </div>
  );
};

export default ObjectPage;
